import React from "react";
import Navbar from "../../Components/Navbar/Navbar";
import "./Home.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Home = () => {
  const renderComponent = () => {
    return (
      <>
        <Navbar />

        <div classNameNameNameName="container">
          <input classNameNameName="main" />
          <span classNameNameName="searchicon"></span>
          <div classNameNameName="microphone">
            <div classNameNameName="mic-stand"></div>
          </div>
          <div classNameNameName="icon-holder">
            <div classNameNameName="icon" id="parking">
              <div classNameNameName="tooltip">Parking</div>
            </div>
            <div classNameNameName="icon" id="gas">
              <div classNameNameName="base"></div>
              <div classNameNameName="tooltip">Gas</div>
            </div>
            <div classNameNameName="icon" id="eat">
              <div classNameNameName="fork"></div>
              <div classNameNameName="knife"></div>
              <div classNameNameName="tooltip">Food</div>
            </div>
            <div classNameNameName="icon" id="coffee">
              <div classNameName="cup"></div>
              <div classNameName="tooltip">Coffee</div>
            </div>
            <div classNameName="icon" id="misc">
              <div classNameName="dots"></div>
              <div classNameName="tooltip">Misc</div>
            </div>
          </div>
        </div>
      </>
    );
  };
  return renderComponent();
};

export default Home;
